import { Component, OnInit } from '@angular/core';
import {MatDialog} from '@angular/material/dialog';
import {MakePurchaseComponent} from '../make-purchase/make-purchase.component';
import {ShopManagerService} from '../../services/shop-manager.service';
import { StockDataService } from 'src/app/services/stock-data.service';
import * as pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-purchases',
  templateUrl: './purchases.component.html',
  styleUrls: ['./purchases.component.sass']
})
export class PurchasesComponent implements OnInit {
  purchases: any[] = []; // holds a list of all purchases from the database
  shop: any;

  constructor(
    private dialog: MatDialog,
    private shopManager: ShopManagerService,
    private stockService: StockDataService) { }

  ngOnInit(): void {
    this.shopManager.getShopSaved().subscribe((shop) => {
      this.shop = shop;
      this.getPurchaseRecords(this.shop.id);
    });
  }

  getPurchaseRecords(shopId: number): void {
    this.stockService.getShopPurchaseOrders(shopId).subscribe((orders: any[]) => {
      orders.forEach((item) => {
        item.generatedAt = new Date(item.generatedAt).toLocaleDateString();
      });
      this.purchases = orders.reverse();
    });
  }

  filterPurchases(value: any): void {

  }

  makePurchase(): void {
    this.dialog.open(MakePurchaseComponent, {
      width: '720px',
      data: {
        shopId: this.shop.id
      }
    }).afterClosed().subscribe(data => {
      this.getPurchaseRecords(data);
    });
  }

  printPurchases(purchases: any[]): void {
    const documentDefinition = {
      content: [
        {
          image: 'data:image/png;base64,',
          width: 100
        },
        {
          columns: [
            [
              { text: `Date - ${new Date(Date.now()).toLocaleDateString()}`, style: 'textRegular'},
              {text: 'Pourtap Limited', style: 'textRegular'},
              {text: 'P.O. Box 456-90100', style: 'textRegular'},
              {
                text: 'Nairobi',
                fontSize: 8,
                style: {
                  margin: [0, 10, 0, 20]
                }
              }
            ],
          ]
        },
        {
          text: `Purchases Report - ${this.shop.name}`,
          bold: true,
          style: 'subHeading'
        },
        {
          table: {
            headerRows: 1,
            widths: ['auto', 'auto', 150 , 'auto' , 'auto', 'auto'],
            heights: (row) => {
              if (row === 0) {
                return 0;
              } else {
                return 17;
              }
            },
            body: [
              ['Date', 'Purchase No.', 'Supplier', 'No. Items', 'Order Total', 'Delivery Status'],
              ...purchases.map((p => (
                [
                  p.generatedAt, p.id, p.supplier.name, p.products.length,
                  p.orderTotal.toFixed(2), p.delivered ? 'Received' : 'Not Received'
                ]))),
              [
                {
                  text: 'Total', fontSize: 8, bold: true, colspan: 6
                }, {}, {}, {}, this.getTotalPurchases(purchases).toFixed(2), {}
              ]
            ]
          },
          layout: 'headerLineOnly',
          fontSize: 7
        },
        {
          text: '',
          margin: [0, 15, 0, 15]
        },
        {
          columns: [
            [
              {text: '', margin: [0, 10, 0, 10]},
              {text: 'Confirmed and signed by:\n\nName ...................................................', style: 'textRegular'},
              {text: 'Signature ..............................................', style: 'textRegular'}
            ]
          ]
        }
      ],
      styles: {
        sectionHeader: {
          margin: [0, 10, 0, 10],
          decoration: 'underline',
          bold: true
        },
        subHeading: {
          margin: [0, 20, 0, 10],
          fontSize: 10
        },
        textRegular: {
          margin: [0, 5, 0, 5],
          fontSize: 8
        }
      }
    };
    const win = window.open('', 'tempWinForPdf');
    pdfMake.createPdf(documentDefinition).print({silent: false}, win); // print the table data
    // win.close();
  }

  private getTotalPurchases(purchases: any[]): number {
    let totalPurchases = 0;
    purchases.forEach((p) => {
      totalPurchases += p.orderTotal;
    });
    return totalPurchases;
  }
}
